from sympy import integer_nthroot
def aupto(lim):
  e, r, lim2 = set(range(2, lim+1, 2)), set(), integer_nthroot(lim//2, 2)[0]
  for n1 in range(1, lim2):
    for n2 in range(n1, lim2):
      for n3 in range(n2, lim+1):
        r.add(2*(n1*n2 + n1*n3 + n2*n3))
  return sorted(e - r)
